import{_ as e,o as t,c as o,O as r}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 17.1-329 Disposition of fees of Clerk of Supreme Court.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/17.1-329.md","filePath":"vacode/17.1-329.md"}'),a={name:"vacode/17.1-329.md"},s=r('<h1 id="§-17-1-329-disposition-of-fees-of-clerk-of-supreme-court" tabindex="-1">§ 17.1-329 Disposition of fees of Clerk of Supreme Court. <a class="header-anchor" href="#§-17-1-329-disposition-of-fees-of-clerk-of-supreme-court" aria-label="Permalink to &quot;§ 17.1-329 Disposition of fees of Clerk of Supreme Court.&quot;">​</a></h1><p>The Clerk of the Supreme Court shall keep an accurate account of all fees and costs collected by him and shall make monthly deposits thereof in a depository, or depositories, approved by the State Treasurer, to the credit of the Commonwealth of Virginia. A report of each deposit shall be promptly submitted to the State Treasurer, and detailed reports thereof shall be made monthly to the State Comptroller. Except as provided in § <a href="http://law.lis.virginia.gov/vacode/17.1-328/" target="_blank" rel="noreferrer">17.1-328</a>, all such fees and costs shall be credited by the Comptroller to the general fund of the state treasury.</p><p>Code 1950, § 14-40; 1964, c. 386, § 14.1-31; 1971, Ex. Sess., c. 156; 1998, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0872" target="_blank" rel="noreferrer">872</a>; 2006, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0623" target="_blank" rel="noreferrer">623</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0718" target="_blank" rel="noreferrer">718</a>.</p>',3),i=[s];function l(n,f,c,p,d,h){return t(),o("div",null,i)}const m=e(a,[["render",l]]);export{u as __pageData,m as default};
